import React from 'react';

function Card(props) {
    const { pokeName, pokePic, eventListener } = props;

    return (
        <div className='card' id={pokeName}>
            <button className='card-button' onClick={eventListener}></button>
            <img src={pokePic} alt={`${pokeName}-pic`}></img>
            <h4>{pokeName}</h4>
        </div>
    )
}

export default Card;
